import { FC } from "react";
import { useTypedSelector } from "../../hooks/useTypedSelector";

const CellList: FC = () => {
  useTypedSelector(({ cells: { order, data } }) => {
    return order.map((id) => data[id]);
  });

  return <div>Cell List</div>;
};

export default CellList;
